    return 0;
  }

  key.length = in.readInt();
  value.length = in.readInt();

  keySerializer.deserialize(in, key.length, key.v);
  valueSerializer.deserialize(in, value.length, value.v);

  return key.length + value.length + KV_HEAD_LENGTH;
}
